INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES ("春咲 ひより", 0, "ねぇねぇ、騎士クン\n手伝ってあげようよ～", "お！\nあそこに困ってそうな人発見！", 0, "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", 1, 2, 1, 1.4, 1001, 0, 1, 0, 0);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES ("草野 優衣", 0, "わ、わたし、\nなに言ってるんだろ\nあはは…", "大切な人を\n守れるようになりたい…って", 0, "みんなみたいに\nわたしも強くならなきゃ", 1, 2, 1, 1.4, 1002, 0, 1, 0, 0);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES ("士条 怜", 0, "少しは磨かれると思いますよ。", "キミに必要な集中力と感性が", 0, "フェンシングを始めてみては？", 1, 2, 1, 1.4, 1003, 0, 1, 0, 0);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES ("穂高 みそぎ", 0, "みそぎはねぇ、\nかくれんぼやりたい！", "今日はなにして遊ぶ？", 0, "ねぇ、にいちゃん！", 1, 2, 1, 1.5, 1004, 0, 1, 0, 0);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES ("風宮 あかり", 0, "私といっしょに…\nいかない？", "ねぇ…", 0, "風宮あかりです", 1, 2, 1, 1.4, 1006, 0, 1, 0, 0);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES ("出雲 宮子", 0, "食べ物の恨みは怖いのー", "プリンたべたいのー", 0, "出雲宮子なのー", 1, 2, 1, 1.5, 1007, 0, 1, 0, 0);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES ("虹村 雪", 0, "いいよ。\n見られることは運命さ…", "キミもボクの美貌に\n吸い寄せられたんだね。", 0, "ボクは虹村雪。", 1, 2, 1, 1.4, 1008, 0, 1, 0, 0);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES ("柊杏奈", 0, "人呼んで「疾風の冥姫」!!", "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", 0, "フッ…聞いて後悔するがいい！", 1, 2, 1, 1.4, 1009, 0, 1, 0, 0);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES ("姫宮 真歩", 0, "ほんまおおきにやわ～♪", "うさぎさん、\n運命の王子はんに巡りあわせてくれて", 0, "マホマホ王国のプリンセス、\nまほ姫どす", 1, 2, 1, 1.5, 1010, 0, 1, 0, 0);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES ("衣之咲 璃乃", 0, "ここで会ったが\n100年目～！", "生き別れたお兄ちゃんを探して\n三千世界！", 0, "衣之咲璃乃です！", 1, 2, 1, 1.4, 1011, 0, 1, 0, 0);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES ("柏崎 初音", 0, "…って、お願い！\n誰にも言わないでおいて～！", "ち、超能力って…\n何のことかな～？", 0, "私はハツネ、\n結構強いんだよ。\nきらーん☆", 1, 2, 1, 1.4, 1012, 0, 1, 0, 0);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES ("美波 鈴奈", 0, "ヒデサイまぢ\nGF（グッドフィーリング）～♪", "一応カリスマ読モJKやってまっす！", 0, "ちょす！\n美波鈴奈だよ～♪", 1, 2, 1, 1.4, 1016, 0, 1, 0, 0);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES ("喜屋武 香織", 0, "でも、沖縄もとってもいいとこさー", "東京は遊園地みたいなところさー", 0, "はいたーい。\n喜屋武香織さー。", 1, 2, 1, 1.4, 1017, 0, 1, 0, 0);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES ("支倉 伊緒", 0, "イオちゃんって呼んでね。", "先生って呼ばれるのは\nくすぐったいから", 0, "支倉伊緒です。", 1, 2, 1, 1.4, 1018, 0, 1, 0, 0);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES ("茜 ミミ", 0, "ミミをおいてかないでぇ～", "あ！/\お兄ちゃ～ん\nまってよ～", 0, "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", 1, 2, 1, 1.5, 1020, 0, 1, 0, 0);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES ("栗林 くるみ", 0, "ふぇぇぇぇぇん……", "あの……\nふぇ……", 0, "あ…あの…えっと…\n栗…林…くるみ…です……", 1, 2, 1, 1.5, 1021, 0, 1, 0, 0);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES ("風宮 より", 0, "なんてありがとうございます！", "こんな私に貴重な時間を\n割いていただき、", 0, "風宮よりです。\nあああああ！", 1, 2, 1, 1.4, 1022, 0, 1, 0, 0);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES ("北条 綾音", 0, "私こっち行きたいー\nね、早く早くー", "おにいちゃんどこいくの？\nえ？", 0, "私、アヤネ！\nぷうきちと一緒についてってあげるね！", 1, 2, 1, 1.5, 1023, 0, 1, 0, 0);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES ("天野 すずめ", 0, "これて何か違う…\nあああすみません！", "ふ、不束者ですが\nどうぞ末永く…って、", 0, "わっ…わっ…私、\n天野すずめといいます！", 1, 2, 1, 1.4, 1025, 0, 1, 0, 0);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES ("倉石 恵理子", 0, "離しませんわ………\n絶対に…!!", "あなたは…運命の……\n伴侶……", 0, "……クスクス…私は\n…倉石恵理子……", 1, 2, 1, 1.4, 1027, 0, 1, 0, 0);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES ("佐々木 咲恋", 0, "…そうでしょ？？", "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", 0, "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", 1, 2, 1, 1.4, 1028, 0, 1, 0, 0);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES ("桜井 望", 0, "あはは、\n私もまだまだだなぁ～", "ぇっと…\nキミ、私のこと知らないの?!", 0, "桜井望だよ！\nよろしくねっ", 1, 2, 1, 1.4, 1029, 0, 1, 0, 0);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES ("ニノン・ジュベール", 0, "ショーグン、\nワタシと一緒に天下統一デース！", "初めまして、\n私はニノン・ジュベール申すデス！", 0, "デケデケデンっ！", 1, 2, 1, 1.4, 1030, 0, 1, 0, 0);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES ("上喜 しのぶ", 0, "おかしいですね……", "でもって私の隣にいるのが……\nえ、見えない？", 0, "上喜しのぶです。\n手元のドクロが父です。", 1, 2, 1, 1.4, 1031, 0, 1, 0, 0);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES ("野戸まひる", 0, "そう、\nオラのボケに突っ込める相方が…！", "けんども\nそれには足りないモンが…", 0, "目指すはビッグな\nお笑い芸人だっぺ！", 1, 2, 1, 1.5, 1033, 0, 1, 0, 0);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES ("綾瀬 ゆかり", 0, "ちょ\nちょっと一杯飲んできます…！", "ちょっと緊張しちゃって…", 0, "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", 1, 2, 1, 1.4, 1034, 0, 1, 0, 0);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES ("氷川 鏡華", 0, "これ以上お話しすることは…\nないです！", "知らない人とは話しちゃいけないので", 0, "氷川鏡華…です", 1, 2, 1, 1.5, 1036, 0, 1, 0, 0);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES ("柏崎 栞", 0, "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", "……あ、アラーム。", 0, "柏崎…栞です。", 1, 2, 1, 1.4, 1038, 0, 1, 0, 0);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES ("双葉 碧", 0, "野に咲く花が、\n唯一の話相手です。", "私、一人も友達がいなくて……", 0, "ふ、双葉碧です。", 1, 2, 1, 1.4, 1040, 0, 1, 0, 0);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES ("三角 千歌", 0, "そう思っています。", "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", 0, "三角千歌です。", 1, 2, 1, 1.4, 1042, 0, 1, 0, 0);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES ("安芸 真琴", 0, "う、疑ってすまなかったな…", "あぁ？\nお前のそいつの仲間か？", 0, "安芸真琴だ。", 1, 2, 1, 1.4, 1043, 0, 1, 0, 0);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES ("イリヤ・オーンスタイン", 0, "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", "生けとし生ける全ての者よ！", 0, "わらわこそは夜を総べる者！", 1, 2, 1, 1.4, 1044, 0, 1, 0, 0);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES ("遠見 空花", 0, "ｌク、クウカに何かご用ですか!?", "ぐふふふふ……はっ！", 0, "そこで騎士は妖精を乱暴に……", 1, 2, 1, 1.4, 1045, 0, 1, 0, 0);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES ("宮坂たまき", 0, "う～ん…\n猫ってホントに最高にゃ～♪", "自由気ままで♪\n寝て遊んで、食べてケンカして…", 0, "宮坂たまきにゃ♪\n猫はいいにゃよ？", 1, 2, 1, 1.4, 1046, 0, 1, 0, 0);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES ("大神 美冬", 0, "…と思ったら\nバイトの時間だ！\nまたあとでね！", "それでは早速クエストに…", 0, "大神美冬よ！", 1, 2, 1, 1.4, 1048, 0, 1, 0, 0);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES ("星野静流", 0, "お姉ちゃんがぜ～んぶ\nやってあげるからね！", "クエストもバトルも\n掃除も洗濯も", 0, "星野静流だよ！", 1, 2, 1, 1.4, 1049, 0, 1, 0, 0);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES ("玉泉美咲", 0, "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪", "見ての通りの\nセクシー美少女で", 0, "アタシは玉泉美咲。", 1, 2, 1, 1.5, 1050, 0, 1, 0, 0);
